      <div class="row">
      <div class="col">
          <Card/>
        </div>
        <div class="col" id="newsfeedid">
          <Newsfeed/>
        </div>
        <div class="col">
          <Card1/>
        </div>

      </div>
    </div>
  </div>



      );
  }
}


export default App;
